{
    const [shoplist,setitemtype] = useState([]);

    //get json to shoplist
    useEffect(()=>{
    const add  = require('./myjson.json');
    setitemtype(add);
    },[])
    return(
    <div className='categories-container '>
    <CatagorieList shoplist = {shoplist}/>
    </div>
    )
}

